query GetTeamIssues($teamId: String!, $first: Int, $after: String) {
  team(id: $teamId) {
    __typename
    id
    issues(first: $first, after: $after) {
      __typename
      nodes {
        __typename
        id
        title
        estimate
        createdAt
        updatedAt
        archivedAt
        description
        assignee {
          __typename
          id
          name
        }
      }
    }
  }
}

